(3586, 3, '_wp_suggested_privacy_policy_content', 'a:3:{s:11:\"plugin_name\";s:11:\"WooCommerce\";s:11:\"policy_text\";s:4743:\"<div class=\"wp-suggested-text\"><p class=\"privacy-policy-tutorial\">Dieses Beispiel zeigt grundlegende Informationen darüber, welche personenbezogenen Daten dein Shop erfassen, speichern und weitergeben sowie wer Zugriff auf diese Daten haben könnte. Abhängig von den aktivierten Einstellungen und den zusätzlich genutzten Plugins werden sich die spezifischen Informationen unterscheiden, die dein Shop nutzt. Wir empfehlen eine Rechtsberatung, um zu klären, welche Informationen deine Datenschutzerklärung enthalten sollte.</p><p>Wir sammeln Informationen über Dich während des Bestellvorgangs in unserem Shop.</p><h2>Was wir sammeln und speichern</h2><p>Während du unsere Website besuchst, zeichnen wir auf:</p><ul><li>Angesehene Produkte: Hier zeigen wir dir Produkte, die du vor Kurzem angesehen hast.</li><li>Standort, IP-Adresse und Browser-Typ: Wir verwenden dies für Zwecke wie die Schätzung von Steuern und Versandkosten</li><li>Versandadresse: Wir werden dich auffordern, diese anzugeben, um beispielsweise die Versandkosten bestimmen zu können, bevor du eine Bestellung aufgibst, und dir die Bestellung zusenden zu können.</li></ul><p>Wir nutzen auch Cookies, um den Inhalt deines Warenkorbs zu verfolgen, während du unsere Website besuchst.</p><p class=\"privacy-policy-tutorial\">Hinweis: Du solltest deine Cookie-Richtlinie mit weiteren Details ergänzen und hier einen Link zu diesem Bereich setzen.</p><p>Wenn du bei uns einkaufst, werden wir dich auffordern, Informationen wie deinen Namen, deine Rechnungs- und Versandadresse, deine E-Mail-Adresse und deine Telefonnummer, Kreditkartendaten/Zahlungsdetails sowie optionale Kontoinformationen wie Benutzername und Kennwort anzugeben. Wir nutzen diese Informationen für folgende Zwecke:</p><ul><li>Zusenden von Informationen über dein Konto und Bestellung</li><li>Antwort auf deine Anfragen, inklusive Erstattungen und Beschwerden</li><li>Bearbeitung von Zahlungsvorgängen und Verhinderung von Betrug</li><li>Richten Sie Ihr Konto für unseren Shop ein</li><li>Einhaltung aller rechtlichen Verpflichtungen, beispielsweise die Steuerberechnung</li><li>Verbesserung unsere Shop-Angebote</li><li>Senden von Marketing-Nachrichten, wenn du diese erhalten möchtest</li></ul><p>Wenn du ein Konto bei uns erstellst, speichern wir deinen Namen, deine Adresse, deine E-Mail-Adresse und deine Telefonnummer. Diese Angaben werden bei künftigen Bestellungen zum Ausfüllen der Bezahlinformationen verwendet.</p><p>Wir speichern Informationen über dich üblicherweise so lange, wie wir sie für den Zweck der Erfassung und Nutzung benötigen und verpflichtet sind, sie zu speichern. Beispielsweise speichern wir Bestellinformationen für XXX Jahre aus Steuer- und Abrechnungsgründen. Dazu gehört dein Name, deine E-Mail-Adresse sowie deine Rechnungs- und Versandadresse.</p><p>Wir speichern auch Kommentare oder Bewertungen, wenn du dich dazu entscheidest diese zu hinterlassen.</p><h2>Wer aus unserem Team hat Zugang</h2><p>Mitglieder unseres Teams haben Zugang zu den Informationen, die du uns zur Verfügung stellst. Zum Beispiel können sowohl Administratoren als auch Shop-Manager auf Folgendes zugreifen:</p><ul><li>Bestellinformationen wie gekaufte Produkte, der Zeitpunkt des Kaufs sowie die Versandadresse und</li><li>Kundeninformationen wie dein Name, E-Mail-Adresse, sowie Rechnungs- und Versandinformationen.</li></ul><p>Unsere Teammitglieder haben Zugriff auf diese Informationen, um Bestellungen zu bearbeiten, Rückerstattungen vorzunehmen und Dich zu unterstützen.</p><h2>Was wir mit anderen teilen</h2><p class=\"privacy-policy-tutorial\">In diesem Bereich solltest du aufführen, an wen und zu welchem Zweck du Daten weitergibst. Dies kann unter anderem Analysen, Marketing, Zahlungs-Gateways, Versandanbieter und Drittanbieter-Elemente umfassen.</p><p>Wir teilen Informationen mit Dritten, die uns helfen, Ihnen unsere Bestellungen und Dienstleistungen anzubieten. Beispielsweise --</p><h3>Zahlungen</h3><p class=\"privacy-policy-tutorial\">In diesem Unterbereich solltest du auflisten, welche externen Zahlungsabwickler die Zahlungen in deinem Shop verarbeiten, da diese Kundendaten verarbeiten können. Wir verwenden PayPal als Beispiel, wenn du PayPal aber nicht nutzt, solltest du dies entfernen.</p><p>Wir akzeptieren Zahlungen mit PayPal. Bei der Zahlungsabwicklung werden einige deiner Daten an PayPal weitergegeben. Hierbei werden ausschließlich erforderliche Informationen für die Verarbeitung oder Durchführung der Zahlung weitergegeben wie beispielsweise Gesamtkaufpreis und Zahlungsinformationen.</p><p>Hier kannst du dir die <a href=\"https://www.paypal.com/us/webapps/mpp/ua/privacy-full\">PayPal Datenschutzerklärung</a> ansehen.</p></div>\";s:5:\"added\";i:1675548112;}'),
(3587, 3, '_wp_suggested_privacy_policy_content', 'a:3:{s:11:\"plugin_name\";s:43:\"Complianz | The Privacy Suite for WordPress\";s:11:\"policy_text\";s:380:\"<p>Diese Website verwendet die Privacy Suite für WordPress von Complianz, um Datensätze über Einwilligungen zu sammeln.&nbsp;Für diese Funktionalität wird deine IP-Adresse anonymisiert und in unserer Datenbank gespeichert.&nbsp;Weitere Informationen findest du in der Complianz <a href=\"https://complianz.io/privacy-statement/\" target=\"_blank\">Datenschutzerklärung</a>.</p>\n\";s:7:\"updated\";i:1685741031;}'),
(3588, 3, '_wp_suggested_privacy_policy_content', 'a:3:{s:11:\"plugin_name\";s:15:\"LiteSpeed Cache\";s:11:\"policy_text\";s:697:\"This site utilizes caching in order to facilitate a faster response time and better user experience. Caching potentially stores a duplicate copy of every web page that is on display on this site. All cache files are temporary, and are never accessed by any third party, except as necessary to obtain technical support from the cache plugin vendor. Cache files expire on a schedule set by the site administrator, but may easily be purged by the admin before their natural expiration, if necessary. We may use QUIC.cloud services to process & cache your data temporarily.Please see <a href=\"https://quic.cloud/privacy-policy/\" target=\"_blank\">https://quic.cloud/privacy-policy/</a> for more details.\";s:5:\"added\";i:1675548112;}'),
(3589, 3, '_wp_suggested_privacy_policy_content', 'a:3:{s:11:\"plugin_name\";s:26:\"WooCommerce Shipping & Tax\";s:11:\"policy_text\";s:305:\"<p>By using this extension, you may be storing personal data or sharing data with external services. <a href=\"https://jetpack.com/support/for-your-privacy-policy/#woocommerce-services\" target=\"_blank\">Learn more about how this works, including what you may want to include in your privacy policy.</a></p>\n\";s:5:\"added\";i:1675548112;}'),
